import React from 'react';
import netflix from './assets/netflix.png';
function Card() {
  return (
    <div className="row">
        <div className="row_posters">
        <h1>Projects</h1>
        <img src={netflix} alt="" className="row_poster" />
        </div>

    </div>
  );
}

export default Card;
